---
 - "\"": [T: tanda kutif]                        # 0x22
 - "#": [T: tagar]                               # 0x23
 - "$": [T: dolar]                               # 0x24
 - "%": [T: persen]                              # 0x25
 - "&": [T: tanda dan]                           # 0x26
 - "'": [T: apostrof]                            # 0x27
 - "(":                                          # 0x28
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [test: {if: "$Verbosity='Terse'", then: {T: buka}, else: {T: buka kurung}}]
        else: [T: buka kurung]
 - ")":                                          # 0x29
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [test: {if: "$Verbosity='Terse'", then: {T: tutup}, else: {T: tutup kurung}}]
        else: [T: tutup kurung]

 - "*": [T: kali]                                # 0x2a
 - "+": [T: tambah]                              # 0x2b
 - "-": [T: kurang]                              # 0x2d
 - ".": [T: titik]                               # 0x2e
 - "/": [T: per]                                 # 0x2f
 - ":": [T: bagi]                                # 0x3a
 - ";": [T: titik koma]                          # 0x3b
 - "<":                                          # 0x3c
     - test: 
         if: "$Verbosity!='Terse'"
         then: {T: ""}
     - T: kurang dari
 - "=": [T: sama dengan]                         # 0x3d
 - ">":                                          # 0x3e
     - test: 
         if: "$Verbosity!='Terse'"
         then: {T: ""}
     - T: lebih besar dari
 - "?": [T: tanda tanya]                         # 0x3f
 - "@": [T: tanda at]                            # 0x40
 - "[":                                          # 0x5b
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: buka kurung siku]
        else: [T: buka kurung siku]
 - "\\": [T: back slash]                          # 0x5c
 - "]":                                           # 0x5d
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: tutup kurung siku]
        else: [T: tutup kurung siku]
 - "^": [T: hat]                                  # 0x5e
 - "_": [T: garis bawah]                          # 0x5f
 - "`": [T: grave accent]                         # 0x60
 - "{":                                           # 0x7b
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: buka kurung kurawal]
        else: [T: buka kurung kurawal]
 - "|":                                           # 0x7c
    # note: for ClearSpeak and SimpleSpeak, "|" in side of sets is handled at the mrow level, same for 'sets'
    - test:
        - if: $SpeechStyle != 'ClearSpeak'
          then: [T: garis vertikal]
        - else_if: "$ClearSpeak_VerticalLine = 'SuchThat'"
          then: [T: sedemikian sehingga]
        - else_if: "$ClearSpeak_VerticalLine = 'Given'"
          then: [T: diberikan]
        - else: [T: membagi]

 - "}":                                          # 0x7d
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: tutup kurung kurawal]
        else: [T: tutup kurung kurawal]

